export default [
  {
    _tag: 'CSidebarNavItem',
    name: 'Dashboard',
    to: '/dashboard',
    icon: 'cil-speedometer',
    badge: {
      color: 'info',
      // text: 'NEW',
    }
  },

  {
    _tag: 'CSidebarNavItem',
    name: 'Manage News',
    to: '/shop',
    icon: 'cil-speedometer',
    badge: {
      color: 'info',
      // text: 'NEW',
    }
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Manage Product',
    to: '/product',
    icon: 'cil-speedometer',
    badge: {
      color: 'info',
      // text: 'NEW',
    },
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Product Category',
        to: '/productCategory',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Product Type',
        to: '/notifications/badges',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Product',
        to: '/product',
      }
    ]

  },

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Manage Sales',
    to: '/product',
    icon: 'cil-speedometer',
    badge: {
      color: 'info',
      // text: 'NEW',
    },
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Sales',
        to: '/productCategory',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Sale History',
        to: '/notifications/badges',
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Product',
        to: '/product',
      }
    ]

  },

  {
    _tag: 'CSidebarNavItem',
    name: 'Manage supplier',
    to: '/supplier',
    icon: 'cil-speedometer',
    badge: {
      color: 'info',
      // text: 'NEW',
    }
  }
]
